import React from 'react'
import './Card.css'

function Card({title,imageUrl,body}) {
  return (
    <div className="card-container">
      <div className="image-container">
        <img src={imageUrl} alt='' />
      </div>
      <div className="card-title"></div>
    </div>
  )
}

export default Card
